import React, { Component} from "react";
import "./profile.css";
import lessangry from "./lessangry.png";
import ChatPro from "./chatpro.js";
import {
	BrowserRouter as Router,
	Link,
} from "react-router-dom";

const tit = () => (
	<div>
		<Profile />
	</div>
);


class Prof extends Component {

	constructor(props) {
		super(props);
		this.state = {
			selectedFile: null,
			error: null,
		}
	}


	onClickHandler = () => {
		console.log('clicked')
		var timestamp = Number(new Date());
		const file = new File([this.state.selectedFile], timestamp)
		console.log(file)
		this.props.firebase.doSubmitFile(file)
	};




	onChangeHandler = event => {
		console.log('changed')
		this.setState({
			selectedFile: event.target.files[0],
			loaded: 0,
		})
	}



	generatePosts() {
		let posts = [];
		for (let i = 0; i < 234; i++) {
			posts.push(
				<Link to="/chatpro" className="Deeznutsidk">
					<div class="profile-post-content"></div>
				</Link>
			);
		}
		console.log(posts);
		return posts;
	}
	render() {
		return ([
			<div class="grid-container">
				<div class="item1">USERNAME</div>
				<div class="item2"><img src={lessangry}></img></div>
				<div class="item3">FRIENDS: 23</div>
				<div class="item4">POSTS: 234</div>
				<div class="item5">MESSAGE</div>
				<div class="item6">FRIEND REQUEST</div>
			</div>,
			<div class="profile-feed">{this.generatePosts()}</div>
		]);

	}
}

export default Profile;
